const BountyForm = (props) => {
    const { handleSubmit, handleChange, btnText, firstName, lastName, side, living } = props
    return(
        <form onSubmit={handleSubmit}>
            <input 
                type="text"
                value={firstName}
                onChange={handleChange}
                placeholder="First Name"/>
            <input 
                type="text"
                value={lastName}
                onChange={handleChange}
                placeholder="Last Name"/>
            <input 
                type="checkbox"
                value={lving}
                onChange={handleChange}
                placeholder="First Name"/>
            <input />
            <input />
            <button>{btnText}</button>
        </form>
    )
}

export default BountyForm;
